import React from 'react';

const CriteriosEvaluacion = () => {
    return (
        <div>
            <div className="formulario">
                <h1>Criterios de Evaluacion</h1>
                <label>Nombre</label>
                <input type="text"></input>
                <label>Apellidos</label>
                <input type="text"></input>
                <label>Rut</label>
                <input type="text"></input>
                
            </div>

        </div>
    )
}

export default CriteriosEvaluacion;
